    );
  }
}
const mapStateToProps = (state) => {
  return {
    listUser: state.listUser,
  };
};
const mapDispatchToProps = (dispatch) => {
  return {
    getAllUser: () => {
      dispatch(actions.getAllUser());
    },
  };
};
export default connect(
  mapStateToProps,
  mapDispatchToProps
)(QuanLyNguoiDungContainer);
